import React from "react";
import axios from "axios";
axios
  .get("/user?ID=12345")
  .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .then(function () {
    // always executed
  });
const Photos = () => {
  return <div></div>;
};

export default Photos;
